import React from 'react';
import './recipePreview.css'

export default function RecipePreview({name, desc, image}) {
  return (
    <div>
      <h3> {name} </h3>
      <div>
        <img src={image} alt="img" width={200}/>
        <p>{desc}</p>
      </div>
	</div>
  );

  return (
    <div class="recipe">
        <div class="recipe-title">
            <h3><a href="omelette.html" style="color:black">French Omelette</a></h3>
        </div>
        <div class="recipe-content">
            <img class="recipe-display-picture" src="https://hips.hearstapps.com/hmg-prod.s3.amazonaws.com/images/delish-how-to-make-an-omelette-horizontal-1542310072.png?crop=0.616xw:0.923xh;0.218xw,0.0281xh&resize=980:*"></img>
            <p class="recipe-description">
                A French omelet is whisked with a fork while the eggs to cook to create a structure more like scrambled eggs and then rolled into a log.
            </p>
        </div>
	</div>
  );
}
